entry.value:
import org.apache.nifi.processor.io.StreamCallback
import org.apache.commons.io.IOUtils
import java.nio.charset.StandardCharsets
import groovy.json.JsonSlurper
import groovy.json.JsonOutput
import groovy.json.JsonBuilder


class MyStreamCallback implements StreamCallback {
    void process(InputStream inputStream, OutputStream outputStream) throws IOException {
        def flowfile_content = IOUtils.toString(inputStream, StandardCharsets.UTF_8)

        def json_content = new JsonSlurper().parseText(flowfile_content)

        def appStatus = mapperStatus(json_content['status'])
        if (appStatus == 'Skip') {
            throw new Exception("Status Skip");
        }

        def appNumber = json_content?.loanAppId ?: ""
        def appDate = json_content?.submitDtm ?: ""
        // def cifNumber = ""

        // if (json_content?.borrowerInfo.size() > 0) {
        //     // cifNumber = json_content?.borrowerInfo[0]?.cifNum ?: ""
        // }

        def payloadMap = [
            Application_Number: appNumber,
            Application_Date: appDate,
            Application_Status: appStatus,
            // CIF_Number: cifNumber,
        ]

        def payloadJson = new JsonBuilder(payloadMap)

        def json_str = JsonOutput.toJson(payloadJson['content'])

        outputStream.write(json_str.getBytes("UTF-8"))
    }

    def mapperStatus(status) {
        switch(status) {
            case 'LNAPP_APPRO_PASS':
                return "Approved"
            case 'LNACC_DECLINE':
            case 'LNAPP_APPRO_FAIL':
            case 'LNACC_AUTOREJECT':
                return "Rejected"
            case 'LNACC_EXPIRED':
                return "Expired"
            case 'LNACC_CREATE':
                return "Done"
            case 'LNACC_CANCEL':
                return "Canceled"
            default:
                return "Skip"
        }
    }
}

def flowFile = session.get()

if (flowFile != null) {
    try {
        session.write(flowFile, new MyStreamCallback())
        session.transfer(flowFile, REL_SUCCESS)
    } catch (Exception e) {
        session.transfer(flowFile, REL_FAILURE)
    }
}
